// src/components/RegistrationList.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const RegistrationList = () => {
  const [customers, setCustomers] = useState([]);

  useEffect(() => {
    const fetchCustomers = async () => {
      try {
        const response = await axios.get('http://localhost:4000/api/customers');
        setCustomers(response.data);
      } catch (error) {
        alert('Error fetching data');
      }
    };

    fetchCustomers();
  }, []);

  return (
    <div className="list-container">
      <header>
        <div className="header-content">
          <h1>Submitted Registrations</h1>
        </div>
      </header>
      <ul>
        {customers.map((customer) => (
          <li key={customer._id}>
            {customer.name} - {customer.place} - {customer.phone} - {customer.source} - {customer.members} - {customer.occupation}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RegistrationList;
